import SignUp from './components/SignUp.vue'
import Home from './components/Home.vue'
import {createRouter,createWebHistory} from 'vue-router'

const routes=[
    {
        name:'Home',
        component:Home,
        path:'/'

    },
    {
        name:'SignUp',
        component:SignUp,
        path:'/SignUp'
    },
]

const router=createRouter({
    history:createWebHistory(),
    routes

})

export default router
